import React, {Component} from 'react';
import CryptoList from './CryptoList';
import axios from 'axios';
import './Crypto.css';

class Crypto extends Component {

    constructor(props) {
        super(props);

        this.state = {
            cryptoList: [],
        }
    }

    componentDidMount = () => {
        this.getCryptoData();
    }

    componentWillUnount = () => {
        
    }


    getCryptoData = () => {
        axios.get('https://blockchain.info/pl/ticker')
            .then(res => {
                let ticker = res.data;
                console.log(ticker);
                let tickerKeysArray = Object.keys(ticker);
                console.log(tickerKeysArray);
                
                let cryptoListArray = tickerKeysArray.map((key) => {
                    return key;
                });

                this.setState({
                    cryptoList: cryptoListArray,
                });

            }).catch(err => {
                console.log(err);
            });
    }


    render = () => {
        return(
            <div className="Crypto">
                Crypto :)
                <CryptoList />
            </div>
        )
    }
}

export default Crypto;
